import React from 'react';
import '../Styling/Login.css';
import usernamelogo from'../Images/username-logo.jpg';
import passwordlogo from'../Images/password-logo.png';

export default function Login() {
  return (
    <div className='container'>
        <form>
            <div className="mb-3">
                <label htmlFor="username" className="username">Username</label>                
                <div className='input-container'>
                    <img src={usernamelogo} alt="Logo"/>
                    <input type="username" className="username" id="username" placeholder="Username"/>
                </div>            
            </div>

            <div className="mb-3">
                <label htmlFor="exampleInputPassword1" className="form-label">Password</label>
                <div className="input-container">
                    <img src={passwordlogo} alt="Logo"/>
                    <input type="password" className="form-control" id="exampleInputPassword1" placeholder='password'/>
                </div>
                
            </div>
            <div className='forget pass'>
            <p>Forget password</p>
            </div>
            
            <button type="submit" class="btn btn-outline-primary">Submit</button>
        </form>
      
    </div>
  );
}
